#include <vector>
#include <iostream>

using namespace std;

#include "Solution.h"

void print_board(vector<vector<char>> & board) {
	for(vector<vector<char>>::iterator line = board.begin(); line != board.end(); line++) {
		for(vector<char>::iterator row = (*line).begin(); row != (*line).end(); row++) {
			cout<<(*row)<<" ";
		}
		cout<<endl;
	}
	cout<<endl;
}

